# flake8: noqa: E501
from pprint import pprint
from unittest.mock import MagicMock, Mock

from offchain.metadata.fetchers.metadata_fetcher import MetadataFetcher
from offchain.metadata.models.metadata import (
    MediaDetails,
    Metadata,
    Attribute,
)
from offchain.metadata.models.token import Token
from offchain.metadata.parsers.collection.nouns import NounsParser
from offchain.web3.contract_caller import ContractCaller


class TestLilNounsParser:
    token = Token(
        chain_identifier="ETHEREUM-MAINNET",
        collection_address="0x4b10701bfd7bfedc47d50562b76b436fbb5bdb3b",
        token_id=39,
        uri=None,
    )

    raw_data = {
        "name": "Noun 39",
        "description": "Noun 39 is a member of the Nouns DAO",
        "image": "data:image/svg+xml;base64,"
    }

    uri = "data:application/json;base64,"
    image_uri = "data:image/svg+xml;base64,"

    def test_lil_nouns_parser_should_parse_token(self):  # type: ignore[no-untyped-def]
        fetcher = MetadataFetcher()
        contract_caller = ContractCaller()
        parser = NounsParser(fetcher=fetcher, contract_caller=contract_caller)  # type: ignore[abstract]
        assert parser.should_parse_token(token=self.token)

    def test_lil_nouns_parser_parses_metadata(self):  # type: ignore[no-untyped-def]
        fetcher = MetadataFetcher()
        contract_caller = ContractCaller()
        fetcher.fetch_mime_type_and_size = MagicMock(return_value=("application/json", 0))  # type: ignore[assignment]
        fetcher.fetch_content = Mock(side_effect=[self.raw_data, self.image_uri])  # type: ignore[assignment]
        parser = NounsParser(fetcher=fetcher, contract_caller=contract_caller)  # type: ignore[abstract]
        parser.get_uri = MagicMock(return_value=self.uri)  # type: ignore[assignment]
        metadata = parser.parse_metadata(token=self.token, raw_data=self.raw_data)
        assert metadata == Metadata(
            token=Token(
                chain_identifier="ETHEREUM-MAINNET",
                collection_address="0x4b10701bfd7bfedc47d50562b76b436fbb5bdb3b",
                token_id=39,
                uri = "data:application/json;base64,"
            ),
            raw_data={
                "name": "Noun 39",
                "description": "Noun 39 is a member of the Nouns DAO",
                "image": "data:image/svg+xml;base64,"
            },
            attributes=[
                Attribute(trait_type="background", value="cool", display_type=None),
                Attribute(trait_type="body", value="orange", display_type=None),
                Attribute(
                    trait_type="accessory",
                    value="checker bigwalk greylight",
                    display_type=None,
                ),
                Attribute(trait_type="head", value="mustard", display_type=None),
                Attribute(
                    trait_type="glasses", value="square black", display_type=None
                ),
            ],
            standard=None,
            name="Noun 39",
            description="Noun 39 is a member of the Nouns DAO",
            mime_type="application/json",
            image=MediaDetails(
                size=0,
                sha256=None,
                uri="data:image/svg+xml;base64,",
                mime_type="image/svg+xml",
            ),
        )
